using System;
using System.Collections.Generic;
using System.Drawing;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AppBarMenu.Helpers
{
  
  public static class FileHelper
  {
    public static string GetCaminhoBase()
    {
      return AppDomain.CurrentDomain.BaseDirectory.ToString();
    }
    public static string[] GetImages()
    {
      string delete_png = @"";
      string details_png = @"";
      string exclude_png = @"";
      string open_file_png = @"";
      string open_png = @"";

      List<string> retorno = new List<string>();

      retorno.Add(delete_png);
      retorno.Add(details_png);
      retorno.Add(open_png);
      retorno.Add(open_file_png);
      retorno.Add(exclude_png);

      return retorno.ToArray();
    }
  }
}
